import React, { Component } from 'react';

export default class Box extends Component {
    state = {
        isCategory: false,
    };

    componentDidMount() {
        if (this.props.isCategory) {
            this.setState({ isCategory: this.props.isCategory });
        }
    }

    render() {
        return {};
    }
}
